import Header from '../components/Header';
import Layout from '../components/layout';
import fetch from 'isomorphic-unfetch';

export default function Index() {

  return (
    <Layout>
      <div className='home-wrap'>
        <Header />
        <h2>Products</h2>

       
      </div>
    </Layout>
  );
}

